import { Box, Stack, Typography } from "@mui/material";
import React from "react";

const Packge = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <Box
        sx={{
          height: "60%",
          backgroundColor: "#fff",
          // opacity: "0.7",
          width: "60%",
          borderRadius: "15px",
          padding: 5,
        }}
      >
        <Stack alignItems="center">
          <div style={{ margin: "20px" }}>
            <Typography variant="h4">Packge</Typography>
          </div>
          <Typography></Typography>
        </Stack>
        <Stack alignItems="center">
          <Typography fontWeight="600">
            ห้างหุ้นส่วนจำกัด น้ำดื่มเพิ่มพูนทรัพย์ (สำนักงานใหญ่)
          </Typography>
          <Typography>Tel: 081-842-2554 , 081-985-3410</Typography>
          <Typography>Email: ppswater@yahoo.com</Typography>
          <FormHelperText
            sx={{
              color: "#fff",
            }}
          >
            © Copyright PPS water
          </FormHelperText>
        </Stack>
        <Stack alignItems="center">
          <Typography fontWeight="600">
            ห้างหุ้นส่วนจำกัด น้ำดื่มเพิ่มพูนทรัพย์ (สำนักงานใหญ่)
          </Typography>
          <Typography>Tel: 081-842-2554 , 081-985-3410</Typography>
          <Typography>Email: ppswater@yahoo.com</Typography>
          <FormHelperText
            sx={{
              color: "#fff",
            }}
          >
            © Copyright PPS water
          </FormHelperText>
        </Stack>
        <Stack alignItems="center">
          <Typography fontWeight="600">
            ห้างหุ้นส่วนจำกัด น้ำดื่มเพิ่มพูนทรัพย์ (สำนักงานใหญ่)
          </Typography>
          <Typography>Tel: 081-842-2554 , 081-985-3410</Typography>
          <Typography>Email: ppswater@yahoo.com</Typography>
          <FormHelperText
            sx={{
              color: "#fff",
            }}
          >
            © Copyright PPS water
          </FormHelperText>
        </Stack>
      </Box>
    </div>
  );
};

export default Packge;
